import {
  Card,
  Row,
  Col,
  CardTitle,
  CardBody,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
} from "reactstrap";

const Project = () => {
  return (
    <div>
      <CardTitle tag="h6" className="border-bottom p-3 mb-0">
        Create Project
      </CardTitle>
      
      <Row className="mt-3">
        <Col>
          <div className="bg-light p-2 border">.col</div>
        </Col>
        <Col>
          <div className="bg-light p-2 border">.col</div>
        </Col>
      </Row>
    </div>
  );
};

export default Project;
